import React from "react";
import '../styles/home.css';

import { Container, Row, Col } from 'reactstrap';
import worldImg from '../assets/images/world.png';
import heroImg from '../assets/images/hero-img01.jpg';
import heroImg02 from '../assets/images/hero-img02.jpg';
import heroVideo from '../assets/images/hero-video.mp4';
import experienceImg from "../assets/images/experience.png";

import Subtitle from './../shared/Subtitle';
import SearchBar from "../shared/SearchBar";
import ServiceList from "../services/ServiceList";
import FeaturedTourList from "../components/Featured-tours/FeaturedTourList";
import MasonryImagesGallery from "../components/Image-gallery/MasonryImagesGallery";
import Testimonials from "../components/Testimonials/Testimonials";
import Newsletter from "../shared/Newsletter";

const Home = () => {
    return (
        <>
            {/* ======= Hero Section Start ======= */}
            <section className="hero">
                <Container>
                    <Row className="align-items-center">
                        <Col lg='6'>
                            <div className="hero__content">
                                <div className="hero__subtitle d-flex align-items-center">
                                    <Subtitle subtitle="Know Before You Go" />
                                    <img src={worldImg} alt="World Icon" />
                                </div>
                                <h1>
                                    Traveling opens the door to creating{" "}
                                    <span className="highlight">memories</span>
                                </h1>
                                <p>
                                    Explore the world like never before with our exclusive tours and travel packages. 
                                    Immerse yourself in new cultures, taste exotic foods, and create unforgettable experiences.
                                </p>
                            </div>
                        </Col>

                        {/* Hero Image & Video */}
                        <Col lg='6' className="d-flex justify-content-center">
                            <div className="hero__media">
                                <img src={heroImg} alt="Traveler" className="hero__img" />
                                <video src={heroVideo} className="hero__video" autoPlay loop muted></video>
                                <img src={heroImg02} alt="Mountains" className="hero__img" />
                            </div>
                        </Col>
                    </Row>

                    <SearchBar />
                </Container>
            </section>
            {/* ======= Hero Section End ======= */}

            {/* ======= Services Section ======= */}
            <section>
                <Container>
                    <Row>
                        <Col lg='3'>
                            <h5 className="services__subtitle">What We Offer</h5>
                            <h2 className="services__title">Our Best Services</h2>
                        </Col>
                        <ServiceList />
                    </Row>
                </Container>
            </section>

            {/* ======= Featured Tours Section ======= */}
            <section>
                <Container>
                    <Row>
                        <Col lg="12" className="mb-5">
                            <Subtitle subtitle="Explore" />
                            <h2 className="featured__tour-title">Our Featured Tours</h2>
                        </Col>
                        <FeaturedTourList />
                    </Row>
                </Container>
            </section>

            {/* ======= Experience Section ======= */}
            <section>
                <Container>
                    <Row className="align-items-center">
                        <Col lg="6">
                            <div className="experience__content">
                                <Subtitle subtitle="Experience" />
                                <h2>With all our experience, <br /> we will serve you</h2>
                                <p>
                                    With over 15 years of experience, we specialize in crafting unforgettable travel experiences. 
                                    Discover new places, meet new people, and make memories that last a lifetime.
                                </p>
                            </div>
                            <div className="counter__wrapper d-flex gap-4">
                                <div className="counter__box">
                                    <span>12k+</span>
                                    <h6>Successful Trips</h6>
                                </div>
                                <div className="counter__box">
                                    <span>2k+</span>
                                    <h6>Regular Clients</h6>
                                </div>
                                <div className="counter__box">
                                    <span>15</span>
                                    <h6>Years of Experience</h6>
                                </div>
                            </div>
                        </Col>
                        <Col lg="6">
                            <div className="experience__img">
                                <img src={experienceImg} alt="Experience" />
                            </div>
                        </Col>
                    </Row>
                </Container>
            </section>

            {/* ======= Gallery Section ======= */}
            <section>
                <Container>
                    <Row>
                        <Col lg="12">
                            <Subtitle subtitle="Gallery" />
                            <h2 className="gallery__title">Visit Our Customers' Tour Gallery</h2>
                        </Col>
                        <Col lg="12">
                            <MasonryImagesGallery />
                        </Col>
                    </Row>
                </Container>
            </section>

            {/* ======= Testimonials Section ======= */}
            <section>
                <Container>
                    <Row>
                        <Col lg="12">
                            <Subtitle subtitle="Fans Love" />
                            <h2 className="testimonial__title">What Our Clients Say</h2>
                        </Col>
                        <Col lg="12">
                            <Testimonials />
                        </Col>
                    </Row>
                </Container>
            </section>

            {/* ======= Newsletter Section ======= */}
            <Newsletter />
        </>
    );
};

export default Home;
